import React, { Component } from "react";
import {
  Button,
  Container,
  Col,
  Row,
  FormGroup,
  FormInput,
  ListGroup,
  ListGroupItem,
  FormSelect,
  FormTextarea,
  Card,
  CardHeader,
  Form
} from "shards-react";

class Homepage extends Component {
  state = {};
  render() {
    return (
      <div>
        <h1>test</h1>
        <Button>boom</Button>
      </div>
    );
  }
}

export default Homepage;
